class Funcionalidades():

# Limpa os campos preenchidos
    def limpa_tela(self):
        self.id_entry.delete(0, END)
        self.data_entry.delete(0, END)
        self.endereco_entry.delete(0, END)
        self.material_entry.delete(0, END)
        self.quantidade_entry.delete(0, END)
        self.uni_entry.delete(0, END)
        self.os_entry.delete(0, END)
        self.encarregado_entry.delete(0, END)
        self.entry_excel.delete(0,END)
# Conecta ao Banco de Dados
    def conecta_bd(self):
        self.conn = sqlite3.connect('banco_controle.bd')
        self.cursor = self.conn.cursor();
        print('Conectando ao banco de dados')
# Desconecta ao Banco de Dados
    def desconecta_bd(self):
        self.conn.close();
        print('Desconectado ao banco de dados')
# Monta as Tabelads do Banco
    def montaTabelas(self):
        self.conecta_bd()
        self.cursor.execute("""
            CREATE TABLE IF NOT EXISTS controle (
               id INTEGER PRIMARY KEY,
               data INTEGER NOT NULL,
               endereco VARCHAR(150),
               material VARCHAR(150),
               quantidade INTEGER(50),
               uni VARCHAR(50),
               os INTEGER(50),
               encarregado VARCHAR(100)
            );
        """)
        self.conn.commit();
        print('Banco de dados criado')
        self.desconecta_bd()
# Variavais
    def variaveis(self):
        self.id = self.id_entry.get()
        self.data = self.data_entry.get()
        self.endereco = self.endereco_entry.get()
        self.material = self.material_entry.get()
        self.quantidade = self.quantidade_entry.get()
        self.uni = self.uni_entry.get()
        self.os = self.os_entry.get()
        self.encarregado = self.encarregado_entry.get()
# Insere valores e MENSAGEM BOX de Falta de Preenchimento de campos
    def add_valores(self):
        self.variaveis()
        if self.data_entry.get() == '':
            msg = "Insira a DATA"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        elif self.endereco_entry.get() == '':
            msg = "Preencha o Campo ENDEREÇO"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        elif self.material_entry.get() == '':
            msg = "Você Esqueceu o Campo MATERIAL"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        elif self.quantidade_entry.get() == '':
            msg = " Faltou a QUANTIDADE"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        elif self.uni_entry.get() == '':
            msg = "A UNI. MEDIDA Também é Importante"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        elif self.os_entry.get() == '':
            msg = "A O.S. Não Pode Ser Esquecida"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        elif self.encarregado_entry.get() == '':
            msg = "Faltou o ENCARREGADO"
            messagebox.showinfo('Cadastro de Material - Aviso!!!', msg)
        else:
            self.conecta_bd()
            self.cursor.execute("""INSERT INTO controle (id,data,endereco,material,quantidade,uni,os,encarregado)
                                   VALUES (?,?,?,?,?,?,?,?)""",
                                (self.id, self.data, self.endereco, self.material, self.quantidade, self.uni, self.os,
                                 self.encarregado))
            self.conn.commit()
            self.desconecta_bd()
            self.select_lista()
            self.limpa_tela()
# Seleciona a lista ID
    def select_lista(self):
        self.lista_mat.delete(*self.lista_mat.get_children())
        self.conecta_bd()
        lista = self.cursor.execute(""" SELECT id,data,endereco,material,quantidade,uni,os,encarregado from controle 
                                        ORDER BY id ASC; """)
        for i in lista:
            self.lista_mat.insert("", END, values=i)
        self.desconecta_bd()
# Evento do click puxando a tabela para os campos
    def OnDoubleClick(self, event):
        self.limpa_tela()
        self.lista_mat.selection()
        for n in self.lista_mat.selection():
            col1, col2, col3, col4, col5, col6, col7, col8 = self.lista_mat.item(n, 'values')
            self.id_entry.insert(END, col1)
            self.data_entry.insert(END, col2)
            self.endereco_entry.insert(END, col3)
            self.material_entry.insert(END, col4)
            self.quantidade_entry.insert(END, col5)
            self.uni_entry.insert(END, col6)
            self.os_entry.insert(END, col7)
            self.encarregado_entry.insert(END, col8)
# Deleta os valores pelo ID
    def deleta_valores(self):
        self.variaveis()
        self.conecta_bd()
        self.cursor.execute("""DELETE FROM controle WHERE id=? """, (self.id,))
        self.conn.commit()
        self.desconecta_bd()
        self.limpa_tela()
        self.select_lista()
# Altera valores da tabela
    def alter_valores(self):
        self.variaveis()
        self.conecta_bd()
        self.cursor.execute("""UPDATE controle SET id=?,data=?,endereco=?,material=?,quantidade=?,uni=?,os=?,encarregado=?
                                WHERE id=?""",
                            (self.id, self.data, self.endereco, self.material, self.quantidade, self.uni, self.os,
                             self.encarregado
                             , self.id))
        self.conn.commit()
        self.desconecta_bd()
        self.select_lista()
        self.limpa_tela()
 # Menu
